import  { useEffect, useState } from 'react';
import React from 'react';
import { useNavigate } from 'react-router-dom';
import CarItem from './CarItem';

function CarList() {
    const [cars, setCars] = useState([]);
    const handleButtonClick = () => {
        console.log("Butonul a fost apăsat!");
    };
    useEffect(() => {
        fetch("http://localhost:8080/api/v1/car")
            .then(response => {
                if (!response.ok) {
                    throw new Error("Eroare la încărcarea datelor");
                }
                return response.json();
            })
            .then(data => {
                console.log("Data received from backend:", data); // Log pentru verificare
                setCars(data);
            })
            .catch(error => console.error("Eroare:", error));
    }, []);

    return (
        <div>
            <h2>Mașinile Disponibile</h2>
            <div className="button">
                <button onClick={handleButtonClick}>Add Car</button>
                
            </div>

            <div className="car-list">
            {cars.length > 0 ? (
                    cars.map((car, index) => (
                        <CarItem key={index} car={car}/>
                    ))
                ) : (
                    <p>Nu există mașini disponibile.</p>
                )}
            </div>
        </div>
    );
}

function MyComponent() {
    const navigate = useNavigate();

    // Funcția care redirecționează utilizatorul la pagina anterioară
    const handleGoBack = () => {
        navigate(-1); // Navighează înapoi la pagina anterioară în istoricul browserului
    };

    // Funcția care redirecționează utilizatorul la o anumită pagină
    const handleGoToHome = () => {
        navigate('/'); // Navighează la pagina de start ("/")
    };

    return (
        <div>
            <button onClick={handleGoBack}>Înapoi</button>
            <button onClick={handleGoToHome}>Pagina de Start</button>
        </div>
    );
}

export default CarList;
